The MovieClip class associates a TimelineTween Timeline with a {{#crossLink "Sprite"}}{{/crossLink}}. It allows
you to create objects which encapsulate timeline animations, state changes, and synched actions. Due to the
complexities inherent in correctly setting up a MovieClip, it is largely intended for tool output.

Currently MovieClip only works properly if it is tick based (as opposed to time based) though some concessions have
been made to support time-based timelines in the future.

@param mode Initial value for the mode property. One of MovieClip.INDEPENDENT, MovieClip.SINGLE_FRAME, or MovieClip.SYNCHED.
@param startPosition Initial value for the startPosition property.
@param loop Initial value for the loop property.
@param labels A hash of labels to pass to the timeline instance associated with this MovieClip.

Use the [Tween] class to animate the properties of a [DisplayObject] like
x, y, scaleX, scaleY, alpha, rotation etc. The animation starts with the
current value of the property and ends at a given target or delta value.

Use one of the predefined [TransitionFunction] functions to control the
progress of the animation (linear, easeInQuadratic, easeInCubic, ...). If
none of the predefined [TransitionFunction] functions fulfills your needs
you can also use one of your own function (see [EaseFunction]).

See also: [Juggler]

Examples:

    var tween = new Tween(mySprite, 1.0, TransitionFunction.easeInCubic);
    tween.delay = 0.5;
    tween.animate.alpha.to(0.0);  // target value = 0.0
    tween.animate.x.by(10.0);     // delta value = 10.0;
    tween.animate.y.by(-10.0);    // delta value = -10.0;
    tween.onComplete = () => print('completed');
    stage.juggler.add(tween);

    var sawtooth = Tween(mySprite, 1.0, (r) => (r * 4).remainder(1.0);
    sawtooth.animate.y.to(10);
    stage.juggler.add(sawtooth);

    stage.juggler.tween(mySprite, 1.0, TransitionFunction.easeInCubic)
      ..delay = 0.5
      ..animate.alpha.to(0.0);

The EaseFunction is the function signature for transitions
used in the [Tween] and [Transition] classes. The function
takes the ration between 0.0 and 1.0 and returns the actual
progress of the transition.

See also: [TransitionFunction], [Tween], [Transition]

Examples:

    // a linear transition
    var transition = (ratio) => ratio;

    // a quadratic transtion
    var transition = (ratio) => ratio * ratio;

The [Transition] class animates a value by calling the onUpdate function continuously.

See also: [Juggler]

Examples:

    var transition = new Transition(0.0, 100.0, 1.0, TransitionFunction.linear);
    transition.onUpdate = (value) => print('the value changed to $value');
    renderLoop.juggler.add(transition);

    stage.juggler.transition(0.0, 100.0, 1.0, TransitionFunction.linear,
        (value) => print('the value changed to $value'));

The Juggler controls the progress of your application by
propagating the time passed between two render frames.

The [RenderLoop] and [Stage] class provides Juggler instances
which are driven by the browsers animation frames. You can also
create your own Juggler instance and control the time by yourself.
Because Juggler implements the [Animatable] interface it can be
added to other Juggler instances too.

See also: [Tween], [Transition], [DelayedCall]

Examples:

    var tween = new Tween(sprite, 1.0, TransitionFunction.easeIn);
    tween.animate.x.to(1.0);
    stage.juggler.add(tween);

    // create a "gameJuggler" who controls all my animations.
    var gameJuggler = new Juggler();
    // start all animations controlled by "gameJuggler".
    stage.juggler.add(gameJuggler);
    // stop all animations controlled by "gameJuggler".
    stage.juggler.remove(gameJuggler);

The DelayedCall class is used to delay the invocation of
a function by a given time.

See also: [Juggler]

Examples:

    var action = () => print("Hello world!");
    var delayedCall = new DelayedCall(action, 1.0);
    juggler.add(delayedCall);

    var action = () => print("Hello world!");
    juggler.delayCall(action, 1.0);

The AnimationGroup class is used to animate multiple Animatables.
Those Animatables are animated in parallel and the onComplete
callback is called when all Animatables have completed.

See also: [Juggler], [AnimationGroup], [Animatable]

Examples:

    var ag = new AnimationGroup();
    ag.add(new Tween(sprite, 2.0, TransitionFunction.easeOutBounce)..animate.x.to(700));
    ag.add(new Tween(sprite, 2.0, TransitionFunction.linear)..animate.y.to(500));
    ag.delay = 1.0;
    ag.onStart = () => print("start");
    ag.onComplete = () => print("complete");
    juggler.add(ag);

    juggler.addGroup([
        new Tween(sprite, 2.0, TransitionFunction.easeOutBounce)..animate.x.to(700),
        new Tween(sprite, 2.0, TransitionFunction.linear)..animate.y.to(500)])
        ..onComplete = () => print("complete");

The AnimationChain class is used to animate multiple Animatables.
Those Animatables are animated one after the other and the onComplete
callback is called when the last Animatable has completed.

See also: [Juggler], [AnimationChain], [Animatable]

Examples:

    var ac = new AnimationChain();
    ac.add(new Tween(sprite, 2.0, TransitionFunction.easeOutBounce)..animate.x.to(700));
    ac.add(new Tween(sprite, 2.0, TransitionFunction.linear)..animate.y.to(500));
    ac.delay = 1.0;
    ac.onStart = () => print("start");
    ac.onComplete = () => print("complete");
    juggler.add(ac);

    juggler.addChain([
        new Tween(sprite, 2.0, TransitionFunction.easeOutBounce)..animate.x.to(700),
        new Tween(sprite, 2.0, TransitionFunction.linear)..animate.y.to(500)])
        ..onComplete = () => print("complete");

This Animatable class declares a common interface
for other classes that can be added to the [Juggler].

See also: [Juggler], [Tween], [Transition], [DelayedCall]

Example:

    class MyAnimation extends Sprite implements Animatable {
      num _totalTime = 0.0;
      bool advanceTime(num time) {
        _totalTime += time;
      }
    }

    var myAnimation = new MyAnimation();
    juggler.add(myAnimation);
